import React, { useState } from 'react';
import styled from 'styled-components';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

import Header from './components/Header';
import Navigation from './components/Navigation';
import LoadingOverlay from './components/LoadingOverlay';
import Dashboard from './components/Dashboard';

const AppContainer = styled.div`
  min-height: 100vh;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
`;

const ContentWrapper = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  padding: 20px;
`;

const MainContent = styled.div`
  display: flex;
  gap: 20px;
  margin-top: 20px;
`;

const NavigationSidebar = styled.div`
  width: 250px;
  flex-shrink: 0;
`;

const ContentArea = styled.div`
  flex: 1;
  min-width: 0;
`;

const PlaceholderPage = styled.div`
  background: white;
  border-radius: 12px;
  padding: 40px;
  text-align: center;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  
  h2 {
    color: #333;
    margin-bottom: 20px;
  }
  
  p {
    color: #666;
    font-size: 1.1rem;
  }
`;

function App() {
  const [isLoading, setIsLoading] = useState(false);
  const [activeSection, setActiveSection] = useState('dashboard');

  const renderContent = () => {
    switch (activeSection) {
      case 'dashboard':
        return <Dashboard setIsLoading={setIsLoading} />;
      case 'datasets':
        return (
          <PlaceholderPage>
            <h2>Datasets Management</h2>
            <p>Dataset upload, management, and preprocessing features will be available here.</p>
          </PlaceholderPage>
        );
      case 'models':
        return (
          <PlaceholderPage>
            <h2>Model Management</h2>
            <p>AI model configuration, training, and evaluation tools will be available here.</p>
          </PlaceholderPage>
        );
      case 'analytics':
        return (
          <PlaceholderPage>
            <h2>Analytics & Reports</h2>
            <p>Detailed analytics, performance metrics, and reporting dashboard will be available here.</p>
          </PlaceholderPage>
        );
      case 'settings':
        return (
          <PlaceholderPage>
            <h2>Settings</h2>
            <p>System configuration, user preferences, and API settings will be available here.</p>
          </PlaceholderPage>
        );
      default:
        return <Dashboard setIsLoading={setIsLoading} />;
    }
  };

  return (
    <AppContainer>
      <ContentWrapper>
        <Header />
        <MainContent>
          <NavigationSidebar>
            <Navigation 
              activeSection={activeSection} 
              onSectionChange={setActiveSection} 
            />
          </NavigationSidebar>
          <ContentArea>
            {renderContent()}
          </ContentArea>
        </MainContent>
      </ContentWrapper>
      
      {isLoading && <LoadingOverlay />}
      
      <ToastContainer
        position="top-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="light"
      />
    </AppContainer>
  );
}

export default App;
